import React from "react";
import ConCard from "./Con-Card";
import image from "./mask-group-nuo.png";

function Cards() {
  return (
    <div className="container mt-4 rounded " style={{ background: "red" }}>
      <div className="row">
        <div className="col-4"  >
          <ConCard
            obj={{
              img: image,
              name: "ayman",
              phone: "+684 34546543",
              email: "sds@gmain.ocom",
            }}
          />
        </div>
        <div className="col-4 "  >
          <ConCard 
            obj={{
              img: image,
              name: "ameen",
              phone: "+684 35689543",
              email: "werwe@gmain.ocom",
            }}
          />
        </div>
        <div className="col-4" >
          <ConCard
            obj={{
              img: image,
              name: "ahmed",
              phone: "+684 6865434",
              email: "sdferwe@gmain.ocom",
            }}
          />
        </div>
      </div>
    </div>
  );
}

export default Cards;
